import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';


function NavBar() {
    return(
        <Navbar style={{ display: 'flex', justifyContent: 'space-around' }}>
            <Navbar.Brand href="#home">VAPA</Navbar.Brand>
                <Nav >
                    <Nav.Link
                    style={{ margin: '10px' }} 
                    href="#link"
                    >H</Nav.Link>

                    <Nav.Link
                    style={{ margin: '10px' }} 
                    href="#link"
                    >Link</Nav.Link>

                    <Nav.Link
                    style={{ margin: '10px' }} 
                    href="#link"
                    >Link</Nav.Link>

                    <Nav.Link
                    style={{ margin: '10px' }} 
                    href="#link"
                    >Link</Nav.Link>

                </Nav>
        </Navbar>
)
}

export default NavBar;
